import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

import Button from 'react-bootstrap/Button';
import hmnlogo from './logoGroup.png';

function NavBar() {
  return (
    <Navbar bg="white" variant="dark" display="flex">
        <Container>
          <Navbar.Brand href="#">
            <img
              alt=""
              src={hmnlogo}
              height="28px"
              margin-top="20px"
              margin-bottom="20px"
              text-align="left"
              className="d-inline-block align-top"
            />{' '}
          </Navbar.Brand>
          <Button margin-top="20px" margin-left="10px">BETA</Button>    
          <Navbar.Text>
            Signed in as: <a href="#login">Mark Otto</a>
          </Navbar.Text>
        </Container>
      </Navbar>

  )
}

export default NavBar;
